//TODO: Order in list podle přidání

const WebFormList = ({ webFields, removeFromList }) => {
  const list = webFields.map(
    ({
      _id,
      fieldName,
      fieldInForm,
      fieldFormVisible,
      fieldOptions,
      fieldType
    }) =>
      fieldInForm ? (
        <li key={_id}>
          {fieldName}
          {fieldFormVisible
            ? `-> visible in form`
            : fieldType === "select"
            ? "-> hidden in form with" + fieldOptions.map(e =>
                e.preselected ? e.value : null
              ) + "as preselected!"
            : null}

          <button id={fieldName} onClick={removeFromList}>
            X
          </button>
        </li>
      ) : null
  );

  return <ul>{list}</ul>;
};

export default WebFormList;
